import React from "react";
import "./Vehicleinfo.css";
import { Link,useNavigate } from "react-router-dom";

const Vehicleinfo = () => {
    const navigate = useNavigate();

  const handleSubmit = (e) => {
    navigate("/Driver-Vehical-infromation");
  };


  return (
    <>
      <div>
      <div className="Main">
      <span className="h2">Vehicle Information</span>
      <form onSubmit={handleSubmit} action="/Driver-Signup/Driver-Vehical-information">
        <input type="text" name="CarCompany" className="mt-2 form-control name" placeholder="Your Car Compnany Name" required/>
        <input type="text" name="CarName" className="mt-2 form-control name" placeholder="Your Car Modal Name" required />
        <input type="number" name="CarModal" className="mt-2 form-control name" placeholder="Your Car Modal Year" min="1900" max="2024" step="1" required />
        <input type="text" name="CarNumber" className="mt-2 form-control name" placeholder="Your Car Number" required />
        <div className="cartype" style={{'display':'flex'}}>
        <label className="" >Enter Car Type&nbsp;</label>
        <select className="mt-2 form-control name">
          <option value="">SUV</option>
          <option value="">Sedan</option>
          <option value="">Hatchback</option>
          <option value="">Coupe</option>
          <option value="">Jeep</option>
        </select>
        </div>
        <input type="email" name="email" className="mt-2 form-control" placeholder="Your Email" required/>
        <input type="password" id="Password" name="password" className="mt-2 form-control" placeholder="Your Password" required/>
        <br/>
        <input type="submit" className="mb-2 btn btn-light mt-2" value="Sign In" />
        <small>
          Already have an account?{" "}
          <Link to="/Driver-Login" className="text-warning">Login</Link>
        </small>
      </form>
    </div>
      </div>
    </>
  )
};
export default Vehicleinfo;
